import React from 'react';

// CSS
import classes from './AccountButton.module.css';

// Component
const AccountButton = () => (
    <div className={classes.AccountButton}>
        <p>Tvoj nalog <i className="fas fa-search"></i></p>
    </div>
);

// Export
export default AccountButton;
